# 自己的版本
import random
class Solution:
    def getLeastNumbers(self, arr: List[int], k: int) -> List[int]:
        # 快速排序
        def partition(left, right):
            # 随机快排
            tmp = random.randint(left, right)
            arr[tmp], arr[left] = arr[left], arr[tmp]
            target = arr[left]
            while left < right:
                # 挖坑法
                while left < right and arr[right] >= target:
                    right -= 1
                arr[left] = arr[right]
                while left < right and arr[left] <= target:
                    left += 1
                arr[right] = arr[left]
            arr[right] = target
            return left
        n = len(arr)
        left = 0
        right = n - 1
        if k == 0:
            return []
        if k == n:
            return arr[:k]
        k -= 1
        # 错误写法
        # index = partition(left, right)
        # # 注意，这种写法是非常不好的！！！因为每次循环，并没有实际改变left和right，我们希望的是在每一次遍历完都会更新left和right的值
        # while index != k:
        #     if index < k:
        #         tmp = partition(index + 1, right)
        #     elif index > k:
        #         tmp = partition(left, index - 1)
        #     index = tmp
        # return arr[:k + 1]

        #正确写法
        # index = partition(left, right)
        # # 注意，这种写法是非常不好的！！！因为每次循环，并没有实际改变left和right，我们希望的是在每一次遍历完都会更新left和right的值
        # while index != k:
        #     if index < k:
        #         left = index + 1
        #         index = partition(left, right)
        #     elif index > k:
        #         right = index - 1
        #         index = partition(left, right)
        # return arr[:k + 1]
        while 1:
            # 每一次partition都相当于一次排序！
            idx = partition(left, right)
            if idx == k:
                return arr[:k+1]
            if idx < k:
                left = idx + 1
            if idx > k:
                right = idx - 1
        return arr[:k + 1]
